import './ExpenseItem.css';

function ExpenseItem() {
    const expenseDate = new Date(2021,3,28);
    const expenseTitle = 'Car Insurrance';
    const expenseDescription = '$267.';


    return(
        <div className='expense-item'>
            <div className='expense-item__description'>March 28th 2021</div>
            <div>
                <h2>Car insurance</h2>
                <div className='expense-item__price'>$ 251.59</div>
            </div>
        </div>
    );
}

export default ExpenseItem;
